import React, { useState } from "react";
import "../../App.css";
import "../Signup.css";

const Signup = () => {
  const [userType, setUserType] = useState("");
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  const handleUserTypeChange = (e) => {
    setUserType(e.target.value);
  };

  const handleNameChange = (e) => {
    setName(e.target.value);
  };

  const handleEmailChange = (e) => {
    setEmail(e.target.value);
  };

  const handlePasswordChange = (e) => {
    setPassword(e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Perform signup logic here (e.g., send data to the server)
    const [userType, setUserType] = useState("");
    const [firstName, setFirstName] = useState("");
    const [lastName, setLastName] = useState("");
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");
    // Add logic to send the data to the server or perform other actions
  };

  return (
    <div className="formContainer">
      {" "}
      {/* Apply the form container class */}
      <h2>Sign Up</h2>
      <form onSubmit={handleSubmit}>
        <div className="formSection">
          {" "}
          {/* Apply the form section class */}
          <label>
            Advisor/Advisee:
            <select
              value={userType}
              onChange={handleUserTypeChange}
              className="inputStyle"
              required
            >
              <option value="">Select</option>
              <option value="advisee">Advisee</option>
              <option value="advisor">Advisor</option>
            </select>
          </label>
        </div>

        <div className="formSection">
          {" "}
          {/* Apply the form section class */}
          <label>
            First Name:
            <input
              type="text"
              value={firstName}
              onChange={handleFirstNameChange}
              className="inputStyle"
              required
            />
          </label>
          <label>
            Last Name:
            <input
              type="text"
              value={lastName}
              onChange={handleLastNameChange}
              className="inputStyle"
              required
            />
          </label>
        </div>

        <div className="formSection">
          {" "}
          {/* Apply the form section class */}
          <label>
            Email:
            <input
              type="email"
              value={email}
              onChange={handleEmailChange}
              className="inputStyle"
              required
            />
          </label>
          <label>
            Password:
            <input
              type="password"
              value={password}
              onChange={handlePasswordChange}
              className="inputStyle"
              required
            />
          </label>
        </div>

        {/* ... (previous code) */}
        <div>
          <button type="submit">Sign Up</button>
        </div>
      </form>
    </div>
  );
};

export default Signup;
